import React from 'react'
import { withStyles } from '@material-ui/core/styles'
import { Box } from '@material-ui/core'
import PropTypes from 'prop-types'
import Buttons  from '../button'

const styles = (theme) => ({
    root : {
        display : "flex",
        flexDirection : "column",
        alignItems  : "space-between",
        width : 200,
        marginBottom : 30,
        marginRight : 15,
        [theme.breakpoints.up("lg")] : {
            marginRight : 16
        },
        [theme.breakpoints.between("md","lg")] : {
            marginRight : 2
        }
    },
    addressCard : {
        padding : 20,
        borderRadius : 10,
        boxShadow: "0px 16px 24px rgba(0, 0, 0, 0.06), 0px 2px 6px rgba(0, 0, 0, 0.04), 0px 0px 1px rgba(0, 0, 0, 0.04)",
        minHeight : 200,
        marginBottom : 20
    },
    button : {
        width : "auto",
        paddingLeft : 20,
        paddingRight : 20
    }
})

const AddressCard = ({ classes, onClickDiv }) => {
    return (
        <Box className={classes.root} onClick={onClickDiv}>
            <Box className={classes.addressCard}/>
            <Buttons className={classes.button} onClick={onClickDiv} >Add New</Buttons>
        </Box>
    )
}

AddressCard.propTypes = {
    image : PropTypes.string,
    onClickDiv : PropTypes.func
}

export default withStyles(styles)(AddressCard)
